==English==
===Etymology===
From {{prefix|en|yester|fang|t2=catch}}.
===Noun===
{{en-noun|-}}
# {{lb|en|rare|obsolete}} That which was captured or caught on the previous day or former occasion; a previous day's catch.
#* {{RQ:Holinshed Chronicles|book=Scotland}}
#*: Although milians and infinite numbers of them [fish] be taken, yet on the next [day] their losse will be so supplied with new store that nothing shall be missing of the '''yesterfang'''.
